import { useRouter } from 'next/router';
const Page = () => {
    const router = useRouter();
    const slug = router.query.slug;
    if(slug === "kyle") {
        return <p style={{ color: 'red' }}>{slug}</p>
    }
    return null;
}

export default Page;
